import React from 'react';
import axios from 'axios';

class Fet extends React.Component{
    componentDidMount(){
        axios.get('https://madhvi.atlassian.net/rest/api/3/search?jql=assignee=madhvikokil')
        .then(response => {
            console.log("response : ",response);
        })
        .catch(error =>{
            console.log("error : ",error);
        })
    }
    render(){
        return(
            <h1>Hello fetching data</h1>
        )
    }
}

export default Fet;
